import { Component, Inject } from '@angular/core';
import { FormsModule, NgForm } from '@angular/forms';
import { IUser } from '../models/interfaces';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-dialog-edit-info',
  templateUrl: './dialog-edit-info.component.html',
  styleUrls: ['./dialog-edit-info.component.less']
})
export class DialogEditInfoComponent {
  user: IUser = {
    id: -1,
    role: "user",
    name: "",
    lastName: "",
    quote: "",
    birthday: "",
    nativeCity: "",
    email: "" ,
    status: "unconfirmed",
    freinds: [],
    password: ""
}

  constructor(@Inject(MAT_DIALOG_DATA) public data : any, private ref : MatDialogRef<DialogEditInfoComponent>){
    this.user.id = this.data.id;
    this.user.role = this.data.role;
    this.user.name = this.data.name;
    this.user.lastName = this.data.lastName;
    this.user.quote = this.data.quote;
    this.user.birthday = this.data.birthday;
    this.user.nativeCity = this.data.nativeCity;
    this.user.email = this.data.email;
    this.user.status = this.data.status;
    this.user.freinds = this.data.freinds;
    this.user.password = this.data.password;
  }

  SendData(): void{
    //this.ref.close(this.user)
  }
}
<h2 mat-dialog-title>Расскажите о себе, {{ data.name }}</h2>
<mat-dialog-content>
    <form>
        <div class="form">
            <label for="name">Имя</label>
            <input placeholder="Имя" [(ngModel)]="this.user.name" name="name" required>

            <label for="lastName">Фамилия</label>
            <input placeholder="Фамилия" [(ngModel)]="this.user.lastName" name="lastName" required>

            <label for="birthday">Дата рождения</label>
            <input placeholder="Дата рождения" [(ngModel)]="this.user.birthday" name="birthday" required>

            <label for="nativeCity">Город</label>
            <input placeholder="Родной город" [(ngModel)]="this.user.nativeCity" name="nativeCity" required>

            <label for="quote">Любимая цитата</label>
            <input placeholder="Любимая цитата" [(ngModel)]="this.user.quote" name="quote" required>
        </div>
    </form>
</mat-dialog-content>
<mat-dialog-actions>
    <button mat-button [mat-dialog-close]="this.user">Сохранить</button>
    <button mat-button [mat-dialog-close]ю="null">Отменить</button>
</mat-dialog-actions>
